import './app.css'

function Expenses(items){

    return (
        <div className='Bigcontainer'>
    <ExpenseItem dat = {items[0].date} title={items[0].title} amount = {items[0].amount}></ExpenseItem>
    <ExpenseItem dat = {items[1].date} title={items[1].title} amount = {items[1].amount}></ExpenseItem>
    <ExpenseItem dat = {items[2].date} title={items[2].title} amount = {items[2].amount}></ExpenseItem>
    <ExpenseItem dat = {items[3].date} title={items[3].title} amount = {items[3].amount}></ExpenseItem>
     </div>
    )
}

export default Expenses;
